import './nav-bar.css';

function NavBar({page, onClick}) {
  return (
        <nav>
            <div id="logo">Young Learning</div>
            <div class={page === "Home" ? "selected" : ""} onClick={onClick("Home")}>Home</div>
            <div class={page === "Play" ? "selected" : ""} onClick={onClick("Play")}>Play</div>
            <div class={page === "About" ? "selected" : ""} onClick={onClick("About")}>About</div>
        </nav>
  );
}

export default NavBar;
